import React , {Component} from 'react'
import CardList from './CardList.js'
import { robots } from './robots';
import SearchBox from './SearchBox.js'

const state = {
    robots: robots,
    searchfield: ''
}

class App extends Component{
    render() {
        return (
            <div className='tc'> 
                <h1> Robot Friends </h1>
                <SearchBox />
                <CardList robots={ robots }/>
            </div>

        
        );
    }
}

export default App;
